import React from "react";
import Head from "next/head";
import "../css/styles.css";

const App = () => {
  return (
    <React.Fragment>
      <Head>
        <title>Pizza box</title>
      </Head>
      <div className="container">
        <header>
          <img src="/img/logo.png" alt="logo" />
          <ul>
            <li>Products</li>
            <li>Videos</li>
            <li>About Company</li>
            <li>Contact Us</li>
          </ul>
          <button></button>
        </header>
      </div>
    </React.Fragment>
  );
};

export default App;
